import React from "react";
import AppLayout from "../components/Layouts/AppLayout";
import Head from "next/head";

const Profile = () => {
    const followerList = [
        { nickname: "1" },
        { nickname: "2" },
        { nickname: "3" },
    ];
    const followingList = [
        { nickname: "1" },
        { nickname: "2" },
        { nickname: "3" },
    ];
    return (
        <>
            <Head>
                {/* _app.js에 title 있지만 여기서 오버라이딩 */}
                <title>내 프로필 | jinho</title>
            </Head>
            <AppLayout>
                <NicknameEditForm></NicknameEditForm>
                <FollowList
                    header="팔로잉 목록"
                    data={followingList}
                ></FollowList>
                <FollowerList
                    header="팔로워 목록"
                    data={followerList}
                ></FollowerList>
            </AppLayout>
        </>
    );
};

export default Profile;
